export default function DrinkCards(props) {
  return (
    <div className='card-wrapper'>
      <img alt='' src={props?.drinks?.strDrinkThumb}></img>
      <span className='cardTitle'>{props?.drinks?.strDrink}</span>
    </div>
  )
}
